import React from "react";
import Logo from "../images/logo.png";

export default function Main() {
  console.log("here");
  return (
    <div>
      <img src={Logo}/>
      <button class="btn btn-primary">Transitional Planning</button>
      <button class="btn btn-primary">Alternative Paths</button>
      <button class="btn btn-primary">Community</button>
    </div>
  );
}
